import React from "react";
import SideBarDD from "../SideBarD";
import AddData from "../AddData";
import WelcomeBarD from "../WelcomeBar";

const DashData = () => {
  return (
    <>
      <DashboardContainer>
        <SideBarContainer>
          <SideBarDD></SideBarDD>
        </SideBarContainer>
        <ContentContainer>
          <WelcomeBarD></WelcomeBarD>
          <AddData></AddData>
        </ContentContainer>
      </DashboardContainer>
    </>
  );
};

export default DashData;
